import React, {Component} from 'react';
import './App.css';

class App extends Component {

  checkHTML(){
    let doc = document.getElementById('form');
    let text = doc.innerHTML;
    return text;
  }

  render(){
    return (
      <div className="App">
        <form action="#" id="form">
          <textarea name="" id="input" cols="30" rows="10"></textarea>
          <button type="submit">Submit</button>
        </form>
      </div>
    );
  }
}

export default App;
